import React from "react";
import "../ExamMaster/Mainpage.css";

const Mainpage = () => {
  return(
  
  <div className="row">

      <div className="col-3"></div>
      <div className="col-6 d-flex mx-30">

          <button className="btn btn-success">Create Exam</button>
          <button className="btn btn-success">Register a User</button>
          <button className="btn btn-success">Update Exam</button>

      </div>
      <div className="col-3"></div>

  </div>
  
  ); 
};

export default Mainpage;
